ISLAMABAD, Jun 23 (APP):The National Assembly session commenced at 11:10 a.m., with Speaker Ayaz Sadiq presiding.
The House is expected to continue the general debate on the federal budget and review the Senate’s recommendations, leading to the winding up of discussions on the Budget for the fiscal year 2025–2026.
